import React from "react";

const ConceptItem = (props) => {
  return (
    <>
      <li className="concept">
        <img src={props.img} alt="TODO: TITLE" />
        <h2>{props.data[0].title}</h2>
        <p>{props.data[0].description}</p>
      </li>
    </>
  );
};

export default ConceptItem;
